function getUniqueValuesFromColumn(){var e={};for(i in allFilters=document.querySelectorAll(".table-filter"),allFilters.forEach(l=>{col_index=l.parentElement.getAttribute("col-index");const t=document.querySelectorAll("#emp-table > tbody > tr");t.forEach(l=>{cell_value=l.querySelector("td:nth-child("+col_index+")").innerHTML,col_index in e?e[col_index].includes(cell_value)||e[col_index].push(cell_value):e[col_index]=new Array(cell_value)})}),e)alert("Column index : "+i+" has Unique values : \n"+e[i]);updateSelectOptions(e)}function updateSelectOptions(e){allFilters=document.querySelectorAll(".table-filter"),allFilters.forEach(l=>{col_index=l.parentElement.getAttribute("col-index"),e[col_index].forEach(e=>{l.innerHTML=l.innerHTML+`\n<option value="${e}">${e}</option>`})})}function filter_rows(){allFilters=document.querySelectorAll(".table-filter");var e={};allFilters.forEach(l=>{col_index=l.parentElement.getAttribute("col-index"),value=l.value,"all"!=value&&(e[col_index]=value)});var l={};const t=document.querySelectorAll("#emp-table tbody tr");t.forEach(t=>{var n=!0;for(var r in allFilters.forEach(e=>{col_index=e.parentElement.getAttribute("col-index"),l[col_index]=t.querySelector("td:nth-child("+col_index+")").innerHTML}),e)if(filter_value=e[r],row_cell_value=l[r],-1==row_cell_value.indexOf(filter_value)&&"all"!=filter_value){n=!1;break}t.style.display=1==n?"table-row":"none"})}